VALUES ('3229820765372', 'Nouilles japonaises saveur Boeuf Teppanyaki', 'Nouilles (56g) : Farine de _blé_ 67%, huile de palme hydrogénée (antioxydants : hydroxyanisol butyle (E320), hydroxytoluène butyle (E321)), amidon de tapioca, sel, épaississant : carboxyméthylcellulose, régulateurs d\'acidité : triphosphate pentasodique, carbonate de potassium, carbonate de sodium. Assaisonnement saveur boeuf (9 g) : _Soja_ en poudre, sel, sucre, légumes déshydratées 2,25% (carotte, oignons), exhausteur de goût : glycine de sodium, ail frit, extrait de levure, poudre de kimchi, arôme boeuf (antioxydant : hydroxytoluène butyle (E321)), épices (ail, poivre noir, cannelle, clou de girofle), graines de _sésame_, exhausteurs de goûts : inosinate disodique, guanylate disodique, poudre de tomate, arôme sauce _soja_, colorant : caramel ordinaire.', 'https://static.openfoodfacts.org/images/products/322/982/076/5372/front_fr.5.400.jpg', '2.8', '1.6', '11', '1.7', '3.9', '2', '0.9', '0.354330708661417', '', '1');

